import React, {Component} from 'react';
import Slider from "react-slick";

class FeaturedClasses extends Component {
    render() {
        const settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1
        };
        return (
            <div className="featured-class">
                <Slider {...settings}>
                    <div>
                        <img src="./assets/doyoga_about_1.jpg" alt="Do Yoga"/>
                    </div>
                </Slider>
            </div>
        );
    }
}

export default FeaturedClasses;
